import * as util from 'cytoscape/src/util';

import coords from 'cytoscape/src/extensions/renderer/base/coord-ele-math/coords';
import edgeArrows from 'cytoscape/src/extensions/renderer/base/coord-ele-math/edge-arrows';
import edgeControlPoints from 'cytoscape/src/extensions/renderer/base/coord-ele-math/edge-control-points';
import edgeEndpoints from 'cytoscape/src/extensions/renderer/base/coord-ele-math/edge-endpoints';
import edgeProjection from 'cytoscape/src/extensions/renderer/base/coord-ele-math/edge-projection';
import labels from 'cytoscape/src/extensions/renderer/base/coord-ele-math/labels';
import nodes from 'cytoscape/src/extensions/renderer/base/coord-ele-math/nodes';
import renderedStyle from 'cytoscape/src/extensions/renderer/base/coord-ele-math/rendered-style';
import zOrdering from 'cytoscape/src/extensions/renderer/base/coord-ele-math/z-ordering';

var BRp = {};

[
  coords,
  edgeArrows,
  edgeControlPoints,
  edgeEndpoints,
  edgeProjection,
  labels,
  nodes,
  renderedStyle,
  zOrdering
].forEach(function( props ){
  util.extend( BRp, props );
});

export default BRp;
